import '../../App.css';

function EnterTheMovie(){

    return(
        <div className="EnterTheMovie">
            <div class="card">
                <div class="container">
                    <h4><b>John Doe</b></h4>
                    <p>Architect & Engineer</p>
                </div>
            </div>        
        </div>      
    );
}

export default EnterTheMovie;
